import React from "react";
import "./Nav.css";
import "../../App.css";

function Nav() {
  state = { clicked : false };
  const scrollToSection = (id) => {
    const element = document.getElementById(id);
    if (element) {
      element.scrollIntoView({ behavior: "smooth" });
    }
  };

  return (
    <nav>
      <div className="navBar">
        <a
          href="#home"
          onClick={(e) => {
            e.preventDefault();
            scrollToSection("home");
          }}
          role="button"
          tabIndex={0}
        >
          Home
        </a>
        <a
          href="#about"
          onClick={(e) => {
            e.preventDefault();
            scrollToSection("about");
          }}
          role="button"
          tabIndex={0}
        >
          About
        </a>
        <a
          href="#projects"
          onClick={(e) => {
            e.preventDefault();
            scrollToSection("projects");
          }}
          role="button"
          tabIndex={0}
        >
          Projects
        </a>
        <a
          href="#contact"
          onClick={(e) => {
            e.preventDefault();
            scrollToSection("contact");
          }}
          role="button"
          tabIndex={0}
        >
          Contact
        </a>
        <div id="mobile">
          <i id="bar" className={this.state.clicked ? 'fas fa-times' :'fas fa-bar'}></i>
        </div>
      </div>
    </nav>
  );
}

export default Nav;
